const canvas = document.getElementById('videoCanvas');
const context = canvas.getContext('2d');
const resultVideo = document.getElementById('resultVideo');
const startButton = document.getElementById('startRecording');
const stopButton = document.getElementById('stopRecording');

// Array of image data (base64 or blob)
const imageArray = [
    '', // Replace with your base64 images
    '', // Replace with your base64 images
    '', // Replace with your base64 images
    // Add more images
];

// Create a MediaRecorder
let mediaRecorder;
let recordedChunks = [];

// Function to start recording
startButton.addEventListener('click', () => {
    recordedChunks = [];
    const stream = canvas.captureStream(60); // 60fps
    mediaRecorder = new MediaRecorder(stream, { mimeType: 'video/webm; codecs=vp8' });

    mediaRecorder.ondataavailable = (event) => {
        if (event.data.size > 0) {
            recordedChunks.push(event.data);
        }
    };

    mediaRecorder.onstop = () => {
        const blob = new Blob(recordedChunks, { type: 'video/webm' });
        const url = URL.createObjectURL(blob);
        resultVideo.src = url;
        resultVideo.play();
    };

    mediaRecorder.start();
    drawImagesToCanvas();
});

// Function to stop recording
stopButton.addEventListener('click', () => {
    if (mediaRecorder) {
        mediaRecorder.stop();
    }
});

// Function to draw images onto the canvas
function drawImagesToCanvas() {
    let index = 0;
    function drawNextImage() {
        if (index < imageArray.length) {
            const image = new Image();
            image.src = imageArray[index];
            image.onload = () => {
                context.clearRect(0, 0, canvas.width, canvas.height);
                context.drawImage(image, 0, 0, canvas.width, canvas.height);
                index++;
                setTimeout(drawNextImage, 1000 / 60); // 60fps
            };
        }
    }
    drawNextImage();
}

document.getElementById('fileInput').addEventListener('change', handleFileSelect);

function handleFileSelect(event) {
    const file = event.target.files[0];
    if (file) {
        const reader = new FileReader();
        
        reader.onloadend = () => {
            // Convert the result to Base64
            const base64 = reader.result.split(',')[1];
            // Display the Base64 string in the textarea
            document.getElementById('base64Output').value = base64;
        };

        // Read the file as a data URL
        reader.readAsDataURL(file);
    }
}